import React from 'react';
import hospimain from './Images/hospimain.jpeg';
import '@fortawesome/fontawesome-free/css/all.css';

function Imagecontainer() {
  return (
    <div className='contain'>
      <div className='img-contain'>
      <img
        src={hospimain}
        width="100%"
        alt="Im should"
      /> </div>
      <div className='texti'>
      <p>Health Care<br/> For Whole Family</p>
      </div>
      <button className='btn'><a className="custom-link" href="https://api.whatsapp.com/send?phone=919454900060&text=Hello%20I%20need%20appointment"><i className="fas fa-phone pr-2 pl-0"></i>
<h3>Book Appointment</h3></a></button>
    </div>
  );
}

export default Imagecontainer;
